import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { useState, useEffect } from "react";
import Navbar from "./components/Navbar";
import Home from "./components/Home";
import Auth from "./components/Auth";
import Events from "./components/Events";
import Resources from "./components/Resources";
import About from "./components/About";
import Feedback from "./components/Feedback";
import Footer from "./components/Footer";
import DiscussionForum from "./components/DiscussionForum";
import Analytics from "./components/Analytics";
import Circular from "./components/Circular";
import ProtectedRoute from "./components/ProtectedRoute";
import { AUTHORIZED_ROLES } from "./config/roles";
import CreateEvent from './components/CreateEvent';
import CreateResource from './components/CreateResource';
import { AuthProvider } from './contexts/AuthContext';

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [userRole, setUserRole] = useState(null);

  useEffect(() => {
    // Check if user is authenticated on app load
    const auth = localStorage.getItem('isAuthenticated');
    const role = localStorage.getItem('userRole');
    if (auth === 'true' && role) {
      setIsAuthenticated(true);
      setUserRole(role);
    }
  }, []);

  const handleLogin = () => {
    const role = localStorage.getItem('userRole');
    setIsAuthenticated(true);
    setUserRole(role);
  };

  const handleLogout = () => {
    localStorage.removeItem('isAuthenticated');
    localStorage.removeItem('userRole');
    localStorage.removeItem('userEmail');
    setIsAuthenticated(false);
    setUserRole(null);
  };

  return (
    <AuthProvider>
      <Router>
        <Navbar 
          onLogout={handleLogout} 
          userRole={userRole} 
          isAuthenticated={isAuthenticated}
          onLogin={handleLogin}
        />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/auth" element={<Auth />} />
          <Route path="/about" element={<About />} />
          <Route path="/events" element={<Events />} />
          <Route path="/resources" element={<Resources />} />
          
          {/* Protected Routes - Only accessible by authorized roles */}
          <Route
            path="/forum"
            element={
              <ProtectedRoute requiredRole={AUTHORIZED_ROLES}>
                <DiscussionForum />
              </ProtectedRoute>
            }
          />
          <Route
            path="/analytics"
            element={
              <ProtectedRoute requiredRole={AUTHORIZED_ROLES}>
                <Analytics />
              </ProtectedRoute>
            }
          />
          <Route
            path="/feedback"
            element={
              <ProtectedRoute requiredRole={AUTHORIZED_ROLES}>
                <Feedback />
              </ProtectedRoute>
            }
          />
          <Route
            path="/circular"
            element={
              <ProtectedRoute requiredRole={AUTHORIZED_ROLES}>
                <Circular />
              </ProtectedRoute>
            }
          />
          <Route path="/events/create" element={<ProtectedRoute><CreateEvent /></ProtectedRoute>} />
          <Route path="/events/edit/:id" element={<ProtectedRoute><CreateEvent /></ProtectedRoute>} />
          <Route path="/resources/create" element={<ProtectedRoute><CreateResource /></ProtectedRoute>} />
          <Route path="/resources/edit/:id" element={<ProtectedRoute><CreateResource /></ProtectedRoute>} />
        </Routes>
        <Footer />
      </Router>
    </AuthProvider>
  );
}

export default App;
